import React, { Component } from "react";
import "./Projects.css";

class Projects extends Component {
  render() {
    return (
      <section id="projects" className="projects">
        <h2>Projects</h2>
        <ul>
          <li>
            <h3>LogIn Page</h3>
            <p>LogIn page Using ReactJS </p>
          </li>
          <li>
            <h3>Portfolio Website</h3>
            <p>Designed and built a responsive personal portfolio.</p>
          </li>
          <li>
            <h3>Wikipedia Search</h3>
            <p>Using Java script Search for Wikipedia</p>
          </li>
        </ul>
      </section>
    );
  }
}

export default Projects;
